import React from "react";
import n from "./New.module.css";

const Users = (props) => {
  return (
    <div className={n.item}>
      {props.users.map((b) => {
        return (
          <div>
            <img src={b.img} />
            <p>{b.fullName}</p>
            <p>{b.status}</p>
            <p>{b.location.city}</p>
            <p>{b.location.country}</p>
            {b.followed ? (
              <button onClick={() => props.unfolow}>unfolow</button>
            ) : (
              <button onClick={() => props.folow}>follow</button>
            )}
          </div>
        );
      })}
    </div>
  );
};

export default Users;
